import logo from "./logo.svg";
import "./App.css";
import ContactsPage from "./components/assamblies/Contacts";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import MainPage from "./components/assamblies/Main";
import ProductList from "./components/assamblies/Product_List";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<MainPage></MainPage>}></Route>
        <Route path="/" element={<MainPage></MainPage>}></Route>
        <Route path="/contacts" element={<ContactsPage></ContactsPage>}></Route>
        <Route path="/product_list" element={<ProductList></ProductList>}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
